import React from "react";
import { Link } from "react-router-dom";
import "./Home.css";

function Home() {
    return (

        <div className="home">
            <div className="header">
                <h1>Registration System</h1>
            </div>
            <h1 className="title">Welcome!</h1>
            <h3 className="subtitle">Tell us WHO are you? &#128513;</h3>

            <div className="butto">
                <Link to="/Auth">
                    <button className="Ad">Admin</button>
                </Link>

                <Link to="/App">
                    <button className="use"> User</button>
                </Link>
            </div>
        </div>
        
    );
}

export default Home;
